function calculateAPR(totalStakedInUsd, rewardsPerDayInUsd, isDateInRange) {
    if (!isDateInRange) return "-";
    else return (365 * Number(rewardsPerDayInUsd) / Number(totalStakedInUsd) * 100).toFixed(2);
}
